// Navigation.jsx
import React from "react";
import { Link } from "react-router-dom";

const Navigation = ({ sidebarData }) => {
  return (
    <nav>
      <ul>
        {sidebarData.map((section, index) => (
          <li key={index}>
            <h3>{section.title}</h3>
            <ul>
              {section.items.map((item, idx) => (
                <li key={idx}>
                  <Link to={item.url}>{item.label}</Link>
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Navigation;
